import logo from './logo.svg';
import React from 'react';
import './App.css';
import './logo.png'



const App = () => {
	return (
		<div>
			<header>
				<img src='./logo.png' />
			</header>
			<nav>
				<div>Profile</div>
				<div>Messages</div>
			</nav>

		 <div>
			Mine content
		 </div>
		</div>
	);
}








export default App;
